import React from 'react';
import { render } from 'react-dom';

class App extends React.Component {
   constructor(props) {
        super(props);    

        // Init default value of counter
        this.state = {
            count: 0
        };
   }



   render() {
       return (
            <div>
                <h2>{this.state.count}</h2>
            </div>
       );
   }
}

export default App;
